SWIMBI - Swift Menu Builder

CSS Drop Down Menu Builder.


Modern-looking menu creator that helps web designers deliver a fully functional CSS menu and embed it in their projects, websites.

Professional menu designs, a lot of options for customizations,
FTP connection.


Windows v.1.2.0

What's new:
- 450+ icons for menu items
- Mobile devices and touch screen support



